ence sets the scene for carefree enjoyment  join us to relish delectable food, refreshing drinks, and make memories in an atmosphere designed for laid-back moments.\r\n\r\n'),(5019,411,'_page_builder_4_add_description_0_description','field_64a7e49119e68'),(5020,411,'page_builder_4_add_description','1'),(5021,411,'_page_builder_4_add_description','field_64805880981a1_field_64a7e49119e67'),(5022,411,'page_builder_4_button','a:3:{s:5:\"title\";s:12:\"Get in touch\";s:3:\"url\";s:28:\"https://spoken.test/contact/\";s:6:\"target\";s:0:\"\";}'),(5023,411,'_page_builder_4_button','field_64805880981a1_field_64a7e4ad3ebb3'),(5024,411,'page_builder_5_acfe_flexible_layout_title','Image Side + Text Side'),(5025,411,'_page_builder_5_acfe_flexible_layout_title','field_layout_648058669819e_title'),(5026,411,'page_builder_5_image_position','right'),(5027,411,'_page_builder_5_image_position','field_64805880981a1_field_64a7e44ffec7b'),(5028,411,'page_builder_5_background_colour','#333945'),(5029,411,'_page_builder_5_background_colour','field_64805880981a1_field_64a7e4d03ebb4'),(5030,411,'page_builder_5_add_pattern','wavy'),(5031,411,'_page_builder_5_add_pattern','field_64805880981a1_field_64a7e5813ebb5'),(5032,411,'page_builder_5_crop_image','full'),(5033,411,'_page_builder_5_crop_image','field_64805880981a1_field_64a7e5ac3ebb6'),(5034,411,'page_builder_5_image','302'),(5035,411,'_page_builder_5_image','field_64805880981a1_field_64a80814cc107'),(5036,411,'page_builder_5_title','Alfresco Dining'),(5037,411,'_page_builder_5_title','field_64805880981a1_field_64a485bdf9b21'),(5038,411,'page_builder_5_add_description_0_description','Experience the joy of alfresco dining at Spoken. Step into our outdoor oasis, where\r\nyou can bask in the sun or choose the cosiness of the canopy. Indulge in our delectable\r\nmenu while soaking in the vibrant atmosphere of The Strand.'),(5039,411,'_page_builder_5_add_description_0_description','field_64a7e49119e68'),(5040,411,'page_builder_5_add_description