rms of service'),(5090,412,'_title','field_648c52f09e93f'),(5091,412,'content','<h5>Introduction</h5>\r\n\r\n<p>These terms and conditions apply between you, the User of this Website (including any sub-domains, unless expressly excluded by their own terms and conditions), and Spoken, the owner and operator of this Website. Please read these terms and conditions carefully, as they affect your legal rights. Your agreement to comply with and be bound by these terms and conditions is deemed to occur upon your first use of the Website. If you do not agree to be bound by these terms and conditions, you should stop using the Website immediately.</p>\r\n\r\n<p>In these terms and conditions, User or Users means any third party that accesses the Website and is not either (i) employed by Spoken and acting in the course of their employment or (ii) engaged as a consultant or otherwise providing services to Spoken and accessing the Website in connection with the provision of such services.\r\nYou must be at least 18 years of age to use this Website. By using the Website and agreeing to these terms and conditions, you represent and warrant that you are at least 18 years of age.</p>\r\n\r\n<h5>Intellectual property and acceptable use</h5>\r\n\r\n<p>All Content included on the Website, unless uploaded by Users, is the property of Spoken, our affiliates or other relevant third parties. In these terms and conditions, Content means any text, graphics, images, audio, video, software, data compilations, page layout, underlying code and software and any other form of information capable of being stored in a computer that appears on or forms part of this Website, including any such content uploaded by Users. By continuing to use the Website you acknowledge that such Content is protected by copyright, trademarks, database rights and other intellectual property rights. Nothing on this site shall be construed as granting, by implication, estoppel, or otherwise, any licence or right to use any trademark, logo or service mark displayed on the site without the owners prior written permission.</p>\r\n\r\n<p>You may, for your own personal, non-commercial use only, do the following:</p>\r\n<ol>\r\n<li>Retrieve, display and view the Content on a computer screen</li>\r\n<li>You must not otherwise reproduce, modify, copy, distribute or use for commercial purposes any Content without the written permission of Spoken</li>\r\n</ol>\r\n\r\n<h5>Prohibited use</h5>\r\n<p>In any way which causes, or may cause, damage to the Website or interferes with any other persons use or enjoyment of the Website;</p>\r\n\r\n<p>In any way which is harmful, unlawful, illegal, abusive, harassing, threatening or otherwise objectionable or in breach of any applicable law, regulation, governmental order;\r\nmaking, transmitting or storing electronic copies of Content protected by copyright without the permission of the owner.</p>\r\n\r\n<h5>Links to other websites</h5>\r\n<p>This Website may contain links to other sites. Unless expressly stated, these sites are not under the control of Spoken or that of our affiliates.</p>\r\n<p>We assume no responsibility for the content of such Websites and disclaim liability for any and all forms of loss or damage arising out of the use of them.\r\nThe inclusion of a link to another site on this Website does not imply any endorsement of the sites themselves or of those in control of them.</p>\r\n\r\n<h5>Privacy policy & Cookies policy</h5>\r\n<p>Use of the Website is also governed by our Privacy Policy and Cookies Policy, which are incorporated into these terms and conditions by this reference. To view the Privacy Policy and Cookies Policy, please click on the relevant links on our website.</p>\r\n\r\n<h5>Availability of the website and disclaimers</h5>\r\n\r\n<p>Any online facilities, tools, services or information that Spoken makes available through the Website (the Service) is provided as is and on an as available basis. We give no warranty that the Service will be free of defects and/or faults. To the maximum extent permitted by the law, we provide no warranties (express or implied) of fitness for a particular purpose, accuracy of information, compatibility and satisfactory quality. Spoken is under no obligation to update information on the Website.</p>\r\n<p>Whilst Spoken uses reasonable endeavours to ensure that the Website is secure and free of errors, viruses and other malware, we give no warranty or guarantee in that regard and all Users take responsibility for their own security, that of their personal details and their computers.\r\nSpoken accepts no liability for any disruption or non-availability of the Website.</p>\r\n<p>Spoken reserves the right to alter, suspend or discontinue any part (or the whole of) the Website including, but not limited to, any products and/or services available. These terms and conditions shall continue to apply to any modified version of the Website unless it is expressly stated otherwise.</p>\r\n\r\n<h5>Limitation of liability</h5>\r\n\r\n<p>Nothing in these terms and conditions will: (a) limit or exclude our or your liability for death or personal injury resulting from our or your negligence, as applicable; (b) limit or exclude our or your liability for fraud or fraudulent misrepresentation; or (c) limit or exclude any of our or your liabilities in any way that is not permitted under applicable law.</p>\r\n<p>We will not be liable to you in respect of any losses arising out of events beyond our reasonable control.\r\nTo the maximum extent permitted by law, Spoken accepts no liability for any of the following:</p>\r\n<ol>\r\n<li>Any business losses, such as loss of profits, income, revenue, anticipated savings, business, contracts, goodwill or commercial opportunities;</li>\r\n<li>Loss or corruption of any data, database or software;</li>\r\n<li>any special, indirect or consequential loss or damage.</li>\r\n</ol>\r\n\r\n<h5>General</h5>\r\n\r\n<p>You may not transfer any of your rights under these terms and conditions to any other person. We may transfer our rights under these terms and conditions where we reasonably believe your rights will not be affected.</p>\r\n<p>These terms and conditions may be varied by us from time to time. Such revised terms will apply to the Website from the date of publication. Users should check the terms and conditions regularly to ensure familiarity with the then current version.</p>\r\n<p>These terms and conditions together with the Privacy Policy and Cookies Policy contain the whole agreement between the parties relating to its subject matter and supersede all prior discussions, arrangements or agreements that might have taken place in relation to the terms and conditions.</p>\r\n<p>The Contracts (Rights of Third Parties) Act 1999 shall not apply to these terms and conditions and no third party will have any right to enforce or rely on any provision of these terms and conditions.</p>\r\n<p>If any court or competent authority finds that any provision of these terms and conditions (or part of any provision) is invalid, illegal or unenforceable, that provision or part-provision will, to the extent required, be deemed to be deleted, and the validity and enforceability of the other provisions of these terms and conditions will not be affected.</p>\r\n<p>Unless otherwise agreed, no delay, act or omission by a party in exercising any right or remedy will be deemed a waiver of that, or any other, right or remedy.</p>\r\n<p>These terms and conditions will be governed by and interpreted according to English law. All disputes arising under these terms and conditions will be subject to the exclusive jurisdiction of the English courts.\r\n</p>\r\n'),(5092,412,'_content','field_648c52fe9e940'),(5093,412,'_yoast_wpseo_metadesc','Find out how Spoken use and protect your data in our privacy and cookie policy. Read more.Here youll find the terms of use of the Spoken website.. Take alook.'),(5094,412,'_yoast_wpseo_title','%%title%% %%page%% %%sep%% %%sitename%% Exmouth'),(5095,413,'page_builder',''),(5096,413,'_page_builder','field_62d823f30eed5'),(5097,413,'title','Terms of service'),(5098,413,'_title','field_648c52f09e93f'),(5099,413,'content','Your trust is important to us, so our Privacy Policy is in accordance with current regulations. This explains how we collect, store, handle and keep your personal information safe. All personal information about you is kept on a secure server and wed never share your details without your permission.\r\n\r\nThis Privacy Policy is applicable to all visitors to the website. By visiting and using our website, you acknowledge and accept the practices outlined in this Privacy Policy.\r\n\r\n<strong>What is Personal Information?</strong>\r\n\r\nPersonal information (or personal data) is information about an individual that allows us to identify that person. In order to provide you with a smooth experience at spokenexmouth.com we collect the following personal information about you:\r\n\r\n<ul>\r\n	<li>Name</li>\r\n\r\n	<li>Date of Birth</li>\r\n\r\n	<li>Email Address*</li>\r\n</ul>\r\n\r\n\r\n*We also collect your email address when you opt in to join our newsletter.\r\n\r\n<strong>When else may my information get collected?</strong>\r\n\r\nInformation regarding your visit to quaysidedistillery.co.uk may be collected by Quayside distilling Ltd or third party providers of advertisements. This includes:\r\n\r\n<ul><li>Your location geographically</li><li>Your browser</li><li>Your device type</li><li>How you were referred to us</li><li>Search terms you used to get to us</li><li>What you browsed on the website</li><li>How long you stayed on the website for</li></ul>\r\n\r\n<strong>How Do We Use Your Personal Information?</strong>\r\n\r\n<p>We want you to have a great experience at quaysidedistillery.co.uk so we use your personal information to make it easy for you to browse.</p>\r\n\r\n\r\n\r\n<p>We may use your information in the ways below:</p>\r\n\r\n\r\n\r\n<ul><li>Information regarding your visit to quaysidedistillery.co.uk including what you have browsed is used to improve your experience on our website.</li><li>Managing your order  youll need an email address to place an order.</li></ul>\r\n\r\n\r\n\r\n<p>We may also contact contact you via the below channels:</p>\r\n\r\n\r\n\r\n<p><strong>Email</strong></p>\r\n\r\n\r\n\r\n<p>We send newsletters to customers and individuals who have given us permission to contact them. These are used to inform you about new launches, sales/special offers and information we think youll find interesting. It is easy to stop receiving these newsletters by clicking on the unsubscribe button found on the bottom of each communication we send.</p>\r\n\r\n\r\n\r\n<p><strong>Phone</strong></p>\r\n\r\n\r\n\r\n<p>If you are a winner of a competition, we will use your personal details to notify you that you have won a prize.</p>\r\n\r\n\r\n\r\n<p><strong>Social Media</strong></p>\r\n\r\n\r\n\r\n<p>If you contact us via social media, we will respond on the same channel or move to email if we feel the conversation needs further assistance.</p>\r\n\r\n<strong>What are your rights?</strong>\r\n\r\nYou have the right to obtain confirmation that your data is being processed, request access to your personal data and the right to be forgotten. You can make a request by email to info@spokenexmouth.com or in writing the below address and we will come back to you within 30 days.\r\n\r\nSpoken\r\n43 The Strand Exmouth, \r\nUK EX8 1AL\r\nUnited Kingdom\r\n\r\nIf you are not satisfied with the way we use your personal information, you have the right to make a complaint with the UKs supervisory authority, the Information Commissioners Office (ICO) https://ico.org.uk/.'),(5100,413,'_content','field_648c52fe9e940'),(5101,212,'_wp_page_template','default'),(5102,212,'_yoast_wpseo_focuskw','Spoken Exmouth Restaurant'),(5103,212,'_yoast_wpseo_title','%%title%% %%page%% %%sep%% %%sitename%% Exmouth'),