09e93f'),(5122,416,'content','<p>Your trust is important to us, so our Privacy Policy is in accordance with current regulations. This explains how we collect, store, handle and keep your personal information safe. All personal information about you is kept on a secure server and wed never share your details without your permission.</p>\r\n\r\n<p>This Privacy Policy is applicable to all visitors to the website. By visiting and using our website, you acknowledge and accept the practices outlined in this Privacy Policy.</p>\r\n\r\n<h5>What is Personal Information?</h5>\r\n\r\n<p>Personal information (or personal data) is information about an individual that allows us to identify that person. In order to provide you with a smooth experience at spokenexmouth.com we collect the following personal information about you:</p>\r\n\r\n<ul>\r\n	<li>Name</li>\r\n\r\n	<li>Date of Birth</li>\r\n\r\n	<li>Email Address*</li>\r\n</ul>\r\n\r\n\r\n<p>*We also collect your email address when you opt in to join our newsletter.</p>\r\n\r\n<h5>When else may my information get collected?</h5>\r\n\r\n<p>Information regarding your visit to quaysidedistillery.co.uk may be collected by Quayside distilling Ltd or third party providers of advertisements. This includes:</p>\r\n\r\n<ul><li>Your location geographically</li><li>Your browser</li><li>Your device type</li><li>How you were referred to us</li><li>Search terms you used to get to us</li><li>What you browsed on the website</li><li>How long you stayed on the website for</li></ul>\r\n\r\n<h5>How Do We Use Your Personal Information?</h5>\r\n\r\n<p>We want you to have a great experience at quaysidedistillery.co.uk so we use your personal information to make it easy for you to browse.</p>\r\n\r\n\r\n\r\n<p>We may use your information in the ways below:</p>\r\n\r\n\r\n\r\n<ul><li>Information regarding your visit to quaysidedistillery.co.uk including what you have browsed is used to improve your experience on our website.</li><li>Managing your order  youll need an email address to place an order.</li></ul>\r\n\r\n\r\n\r\n<p>We may also contact contact you via the below channels:</p>\r\n\r\n\r\n\r\n<h5>Email</h5>\r\n\r\n\r\n\r\n<p>We send newsletters to customers and individuals who have given us permission to contact them. These are used to inform you about new launches, sales/special offers and information we think youll find interesting. It is easy to stop receiving these newsletters by clicking on the unsubscribe button found on the bottom of each communication we send.</p>\r\n\r\n\r\n\r\n<h5>Phone</h5>\r\n\r\n\r\n\r\n<p>If you are a winner of a competition, we will use your personal details to notify you that you have won a prize.</p>\r\n\r\n\r\n\r\n<h5>Social Media</h5>\r\n\r\n\r\n\r\n<p>If you contact us via social media, we will respond on the same channel or move to email if we feel the conversation needs further assistance.</p>\r\n\r\n<h5>What are your rights?</h5>\r\n\r\n<p>You have the right to obtain confirmation that your data is being processed, request access to your personal data and the right to be forgotten. You can make a request by email to info@spokenexmouth.com or in writing the below address and we will come back to you within 30 days.</p>\r\n<p>\r\nSpoken\r\n43 The Strand Exmouth, \r\nUK EX8 1AL\r\nUnited Kingdom</p>\r\n\r\nIf you are not satisfied with the way we use your personal information, you have the right to make a complaint with the UKs supervisory authority, the Information Commissioners Office (ICO) https://ico.org.uk/.'),(5123,416,'_content','field_648c52fe9e940'),(5126,419,'_wp_attached_file','2023/08/bundo-kim-UV-umbbMzzE-unsplash-1.jpg'),(5127,419,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:962;s:6:\"height\";i:962;s:4:\"file\";s:44:\"2023/08/bundo-kim-UV-umbbMzzE-unsplash-1.jpg\";s:8:\"filesize\";i:165407;s:5:\"sizes\";a:4:{s:9:\"thumbnail\";a:5:{s:4:\"file\";s:44:\"bundo-kim-UV-umbbMzzE-unsplash-1-500x500.jpg\";s:5:\"width\";i:500;s:6:\"height\";i:500;s:9:\"mime-ty