und the table, savouring the rich and vibrant flavours of the Mediterranean. And the best part? You\'ll be enjoying it all with a generous 15% off on all our mouthwatering food\r\nofferings.'),(6201,429,'_page_builder_0_add_description_1_description','field_64a7ed86b797e'),(6202,429,'page_builder_0_add_description_2_description','From delicious charcuterie that melts in your mouth, to artisan flatbreads that transport you to sun-soaked shores, and the irresistible aroma of harissa-roasted meat that tingles your taste buds  our menu is a treasure trove of delights waiting to be explored. With your Locals Card, every meal becomes a celebration, and every bite is a moment of pure bliss. Not only will you be treating yourself to unforgettable dining experiences, but you\'ll also be supporting your community. It\'s a win-win.'),(6203,429,'_page_builder_0_add_description_2_description','field_64a7ed86b797e'),(6204,429,'page_builder_0_add_description_3_description','Sign up for your Locals Card today and join us in creating a tapestry of memories, flavours, and savings that\'ll make every meal truly special. Come on over and immerse yourself in the Mediterranean magic that\'s right at your doorstep.'),(6205,429,'_page_builder_0_add_description_3_description','field_64a7ed86b797e'),(6206,429,'show_mailchimp_subscribe_form','hide'),(6207,429,'_show_mailchimp_subscribe_form','field_64e21dc9509d2'),(6208,208,'show_mailchimp_subscribe_form','hide'),(6209,208,'_show_mailchimp_subscribe_form','field_64e21dc9509d2'),(6210,432,'page_builder','a:4:{i:0;s:16:\"hero_page_header\";i:1;s:20:\"gallery_text_section\";i:2;s:17:\"work_with_us_grid\";i:3;s:12:\"career_block\";}'),(6211,432,'_page_builder','field_62d823f30eed5'),(6212,432,'page_builder_0_acfe_flexible_layout_title','Hero | Page Header'),(6213,432,'_page_builder_0_acfe_flexible_layout_title','field_layout_64a4887e16064_title'),(6214,432,'page_builder_0_background_image','293'),(6215,432,'_page_builder_0_background_image','fiel