flavours of the Mediterranean. And the best part? You\'ll be enjoying it all with a generous 15% off on all our mouthwatering food\r\nofferings.'),(6575,450,'_page_builder_0_add_description_1_description','field_64a7ed86b797e'),(6576,450,'page_builder_0_add_description_2_description','From delicious charcuterie that melts in your mouth, to artisan flatbreads that transport you to sun-soaked shores, and the irresistible aroma of harissa-roasted meat that tingles your taste buds  our menu is a treasure trove of delights waiting to be explored. With your Locals Card, every meal becomes a celebration, and every bite is a moment of pure bliss. Not only will you be treating yourself to unforgettable dining experiences, but you\'ll also be supporting your community. It\'s a win-win.'),(6577,450,'_page_builder_0_add_description_2_description','field_64a7ed86b797e'),(6578,450,'page_builder_0_add_description_3_description','Sign up for your Locals Card today and join us in creating a tapestry of memories, flavours, and savings that\'ll make every meal truly special. Come on over and immerse yourself in the Mediterranean magic that\'s right at your doorstep.'),(6579,450,'_page_builder_0_add_description_3_description','field_64a7ed86b797e'),(6580,450,'show_mailchimp_subscribe_form','hide'),(6581,450,'_show_mailchimp_subscribe_form','field_64e21dc9509d2'),(6582,451,'page_builder','a:10:{i:0;s:9:\"hero_main\";i:1;s:13:\"intro_section\";i:2;s:20:\"image_side_text_side\";i:3;s:20:\"image_side_text_side\";i:4;s:11:\"quote_block\";i:5;s:20:\"gallery_text_section\";i:6;s:20:\"image_side_text_side\";i:7;s:26:\"full_width_image_breakdown\";i:8;s:11:\"quote_block\";i:9;s:19:\"testimonials_slider\";}'),(6583,451,'_page_builder','field_62d823f30eed5'),(6584,451,'page_builder_0_acfe_flexible_layout_title','Hero Main'),(6585,451,'_page_builder_0_acfe_flexible_layout_title','field_layout_64a4884d16061_title'),(6586,451,'page_builder_0_background_image','284'),(6587,451,'_page_builder_0_backgr