armth of the summer or observing the world from indoors on those cooler,\r\nAutumnal days.\r\n'),(6611,451,'_page_builder_1_add_description_0_description','field_64a7e24792c9b'),(6612,451,'page_builder_1_add_description','2'),(6613,451,'_page_builder_1_add_description','field_64a488a116069_field_64a7e23e92c9a'),(6614,451,'page_builder_1_add_description_copy',''),(6615,451,'_page_builder_1_add_description_copy','field_64a488a116069_field_64a7ed86b797d'),(6616,451,'page_builder_1_button','a:3:{s:5:\"title\";s:8:\"About Us\";s:3:\"url\";s:26:\"https://spoken.test/about/\";s:6:\"target\";s:0:\"\";}'),(6617,451,'_page_builder_1_button','field_64a488a116069_field_64a7e26492c9c'),(6618,451,'page_builder_1_add_description_1_description','Our menu features an array of small plates, sharers and larger plates, all crafted from the\r\nfinest ingredients and our bar serves as a perfect rendezvous for post-work gatherings or\r\nevening cocktails, boasting an unparalleled spirits library that earned us the distinction of\r\nbeing voted the UK\'s premier spirits bar.'),(6619,451,'_page_builder_1_add_description_1_description','field_64a7e24792c9b'),(6620,451,'page_builder_2_acfe_flexible_layout_title','Image Side + Text Side'),(6621,451,'_page_builder_2_acfe_flexible_layout_title','field_layout_648058669819e_title'),(6622,451,'page_builder_2_image_position','left'),(6623,451,'_page_builder_2_image_position','field_64805880981a1_field_64a7e44ffec7b'),(6624,451,'page_builder_2_background_colour','#325A51'),(6625,451,'_page_builder_2_background_colour','field_64805880981a1_field_64a7e4d03ebb4'),(6626,451,'page_builder_2_add_pattern','dot'),(6627,451,'_page_builder_2_add_pattern','field_64805880981a1_field_64a7e5813ebb5'),(6628,451,'page_builder_2_crop_image','full'),(6629,451,'_page_builder_2_crop_image','field_64805880981a1_field_64a7e5ac3ebb6'),(6630,451,'page_builder_2_title','Eat together'),(6631,451,'_page_builder_2_title','field_64805880981a1_field_64a485bdf9b21'),(6632,451,'pag