r by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</p>\r\n</blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>...or something like this:</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:quote -->\r\n<blockquote class=\"wp-block-quote\">\r\n<p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p>\r\n</blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>As a new WordPress user, you should go to <a href=\"https://spoken.test/wp/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\r\n<!-- /wp:paragraph -->','Home','','inherit','closed','closed','','2-revision-v1','','','2023-07-04 22:09:16','2023-07-04 21:09:16','',2,'https://spoken.test/?p=186',0,'revision','',0),(187,1,'2023-07-04 22:12:04','2023-07-04 21:12:04','','Sam H','','publish','closed','closed','','sam-h','','','2023-07-04 22:12:04','2023-07-04 21:12:04','',0,'https://spoken.test/?post_type=structures&#038;p=187',0,'structures','',0),(188,1,'2023-07-04 22:12:04','2023-07-04 21:12:04','','Sam H','','inherit','closed','closed','','187-revision-v1','','','2023-07-04 22:12:04','2023-07-04 21:12:04','',187,'https://spoken.test/?p=188',0,'revision','',0),(189,1,'2023-07-04 22:12:22','2023-07-04 21:12:22','','Rachael L','','publish','closed','closed','','rachael-l','','','2023-07-04 22:12:22','2023-07-04 21:12:22','',0,'https://spoken.test/?post_type=structures&#038;p=189',0,'structures','',0),(190,1,'2023-07-04 22:12:22','2023-07-04 21:12:22','','Rachael L','','inherit','closed','closed','','189-revision-v1','','','2023-07-04 22:12:22','2023-07-04 21:12:22','',189,'https://spoken.test/?p=190',0,'revision','',0),(191,1,'2023-07-04 22:12:42','2023-07-04 21:12:42'